import React, { Component } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import ListaPedidos from "./listConsumo";

type Pedido = {
  id: number;
  nomeProduto: string;
  valor: number;
  nomeServico: string;
  idProduto: number;
  idServico: number;
};

class App extends Component {
  pedidos: Pedido[] = [
    {
      id: 1,
      nomeProduto: "Produto A",
      valor: 100.0,
      nomeServico: "Serviço X",
      idProduto: 101,
      idServico: 201,
    },
    {
      id: 2,
      nomeProduto: "Produto B",
      valor: 150.0,
      nomeServico: "Serviço Y",
      idProduto: 102,
      idServico: 202,
    },
  ];

  editarPedido = (id: number) => {
    console.log(`Editar pedido com id: ${id}`);
    // Adicione lógica de navegação ou manipulação
  };

  excluirPedido = (id: number) => {
    console.log(`Excluir pedido com id: ${id}`);
    // Adicione lógica para excluir pedido
  };

  render() {
    return (
      <BrowserRouter>
        <Routes>
          {/* Outras rotas do seu aplicativo */}
          <Route
            path="/listaPedidos"
            element={
              <ListaPedidos
                pedidos={this.pedidos}
                onEditar={this.editarPedido}
                onExcluir={this.excluirPedido}
              />
            }
          />
        </Routes>
      </BrowserRouter>
    );
  }
}

export default App;
